  NavLink,
} from "reactstrap";

const Navbarr = (props) => {
  const [] = useState(true);

  return (
    <div>
      <Navbar color="faded" light>
        <NavbarBrand href="/" className="mr-auto">
          reactstrap
        </NavbarBrand>
      </Navbar>
    </div>
  );
};

export default Navbarr;
